const jss = function() {
    "use strict";
    function n(t, e) {
        this.el = t, this.NodeList = document.querySelectorAll(t), this.style(e);
    }
    return n.prototype.style = function(n) {
        let t = Object.keys(n);
        this.NodeList.forEach(function(e) {
            t.forEach(t => {
                e.style[t] = n[t];
            });
        });
    }, function(t, e) {
        return new n(t, e);
    };
}();